import React, { useState } from "react";
import {Link, BrowserRouter as Router} from 'react-router-dom';
import TestOverlay from "../camera/camera";
import "./step3.css"
const Step3 = (props) => {
    
    return (
        //<Router>
        <div className="start">
            <div className = "sideMenu">
              <div className = "step1_2"> STEP1</div>
              <div className = "step2_2"> STEP2</div>
              <div className = "step3_2"> STEP3</div>
            </div>
            <div className = "chooseOp">STEP 3. Connect the Camera</div>
            <div className = "step3Todo">
              <div className = "cam">
                <TestOverlay sound = {props.sound} sound1 = {props.sound1} sound2 = {props.sound2} sound3 = {props.sound3} sound4 = {props.sound4} alertt = {props.alertt} />
              </div>
            </div>
        </div>
        
        //</Router>
    );
    
  };
export default Step3
